import { useSelector } from 'react-redux'
import { useParams } from 'react-router-dom'

const Ship = () => {
  const id = useParams().id
  console.log(id)
  const ship2 = useSelector(state => state.ships[0])
  const ship = useSelector(state => state.ships.find(ship => ship.id === id))
  console.log(ship)
  console.log(ship2)

  if (!ship) {
    return null
  }

  //const own = user && user.username === ship.user.username

  return (
    <div className='ship'>
      <h3>{ship.title} by {ship.owner}</h3>
      <div>
        <div>{ship.built}</div>
        <div>length {ship.lengthMeters}</div>
      </div>
    </div>
  )
}

export default Ship
